import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="row">
        <div className="col-sm-4" style={{backgroundColor:'#252525'}}>.col-sm-4</div>
        <div className="col-sm-4" >.col-sm-4</div>
        <div className="col-sm-4" >.col-sm-4</div>
      </div>
    </div>
  );
}

export default App;
